scripts:
	function hide_empty_dates( ){
		document.querySelectorAll( '.events-date' ).forEach( function( elem ){
			var hide = true;
			var sibling = elem.nextElementSibling;
			while( sibling ){
                if( sibling.matches( '.events-date' ) ) break;
                if( sibling.offsetParent !== null ){
                	hide = false; break;
                }
                sibling = sibling.nextElementSibling;
            }
            if( hide ) elem.style.display = 'none';
            else elem.style.display = 'list-item';
		});
	}

	function search_events( keywords ){
		document.querySelectorAll( '.list-events>li.wrap-events-item' ).forEach(function( item ){

			item.style.display = 'list-item';

			var ev = item.querySelector( '.item-event' ).innerText;
			var le = item.querySelector( '.event-desc' ).innerText;

			ev = ev.replace( /е/gi, 'e' );
			ev = ev.replace( /о/gi, 'o' );
			ev = ev.replace( /а/gi, 'a' );
			ev = ev.replace( /у/gi, 'y' );
			ev = ev.replace( /с/gi, 'c' );
			ev = ev.replace( /р/gi, 'p' );
			ev = ev.replace( /і/gi, 'i' );

			var hide = false;
			keywords.forEach(function(key){
				if( key.match( /\bepl\b/i ) ) key = 'England. Premier League';
				if( key.match( /\bseria\sa\b/i ) ) key = 'Serie a';
				if( key.match( /\bLa\sLiga\b/i ) ) key = 'Spain. Primera Division';
				if( !ev.match( new RegExp( key, 'gi' ) ) && !le.match( new RegExp( key, 'gi' ) ) )
					hide = true;
			});

			if( hide ) item.style.display = 'none';

		});
		hide_empty_dates( );
	}

	document.addEventListener( 'keyup', function( e ){
	    if( e.target.getAttribute( 'name' ) == 'search-events' ){
	    	var keywords = [ ];
	    	var leagues = document.querySelector( 'input[name="league"]' ).value;
	    	if( !!leagues && leagues !== 'all' ) keywords.push( leagues );
	    	if( e.target.value && e.target.value.length >= 3 ){
	    		keywords.push( e.target.value );
	    		search_events( keywords );
	    	}
	    	else{
	    		search_events( keywords );
	    	}
	    }
	});

	$( '.ui.selection.dropdown' ).dropdown({
		onChange: function( value ){
			var keywords = [ ];
	    	var search = document.querySelector( 'input[name="search-events"]' ).value;
	    	if( !!search ) keywords.push( search );
	    	if( !!value ) {
	    		if( value !== 'all' ) keywords.push( value );
	    		search_events( keywords );
	    	}
		},
		fullTextSearch: true
	});

